import React, { Component } from "react";
import "./components.css";

class Hero extends Component {
  state = {};
  render() {
    return (
      <main className="hero">
        <div>
          <h3>Hello There!</h3>
          <div id="name">I'm &nbsp; Vraj.</div>
        </div>
        <div id="prof">
          <li>Developer</li>
          <li>Photographer</li>
          <li>Designer</li>
        </div>
      </main>
    );
  }
}

export default Hero;
